import React from 'react'

export default function (props) {
  return (
    <div>
        <div className="container">
            <div className="mb-3">
                <label for="textbox" class="form-label">{props.heading}</label>
                <textarea   className="form-control" name="" id="textbox" cols="30" rows="10"></textarea>
            </div>
        </div>
    </div>
  )
}
